export default function processMatches(context: QContext, done) {
  let idx = 0;
  function nextMatch() {
    if (idx === context.matches.length) {
      updateState(context, done);
      return;
    }
    Q(
      foundLifecycle,
      { ...context, match: context.matches[idx] },
      function end() {
